      out.write("        var exdate = new Date();\r\n");
      out.write("        exdate.setDate(exdate.getDate() + exdays);\r\n");
      out.write("        var cookieValue = escape(value) + ((exdays==null) ? \"\" : \"; expires=\" + exdate.toGMTString());\r\n");
